import React from 'react';


const Repository: React.FC = () => {
  return (
    <>
      <h1>Sonha em trabalhar no Google? <br></br>Confira tudo que você precisa saber!</h1>
      <p>Em 1998, os doutorandos da Universidade de Stanford Larry Page e Sergey Brin fundaram o Google, que viria a ser uma das maiores empresas de serviços online e software do mundo. Por conta de seu alto nível de inovação e sua cultura descontraída, trabalhar no Google se tornou o sonho de grande parte dos jovens profissionais. Com 21 anos no mercado, a multinacional é avaliada em aproximadamente US$ 309 bilhões, de acordo com o ranking BrandZ 2019, divulgado na Bolsa de Valores de Nova York em junho deste ano.</p>
    </>
  );
}


export default Repository;
